import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Icon from '@material-ui/core/Icon';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
//import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
    root: {
        '& > *': {
            margin: theme.spacing(1),
            width: '50ch',
        },
    },
    margin: {
        margin: theme.spacing(10),
    },
    marginBottom: {
        marginBottom: '5px'
    }
}));

export default function GoesEmpresas() {
    const classes = useStyles();
    return (
        <form className={classes.root} noValidate autoComplete="off">
         {/*    <FormControl fullWidth>
                <TextField
                    id="description"
                    name="description"
                    label="Escribe la Misión de la empresa"
                    type="text"
                    multiline
                    rows={5}
                    variant="outlined"
                    fullWidth
                    
                /> 
            </FormControl> */}

            <FormControl fullWidth className={classes.marginBottom}>
                <InputLabel htmlFor="standard-adornment-amount" className={classes.marginBottom}
                > <Icon className="text-60" color="action"> business</Icon> Escribe la Misión de la empresa</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    multiline
                    rows={5}
                    variant="outlined"
                    fullWidth
                    endAdornment={<InputAdornment position="end">  <Icon className="text-30" color="action">
                        help
						</Icon></InputAdornment>}
                />
            </FormControl>
            <FormControl fullWidth className={classes.marginBottom}>
                <InputLabel htmlFor="standard-adornment-amount" className={classes.marginBottom}
                > <Icon className="text-60" color="action"> business</Icon> Escribe la Visión de la empresa</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    multiline
                    rows={5}
                    variant="outlined"
                    fullWidth
                />
            </FormControl>
            <FormControl fullWidth className={classes.marginBottom}>
                <InputLabel htmlFor="standard-adornment-amount" className={classes.marginBottom}
                > <Icon className="text-60" color="action"> business</Icon> Escribe los valores que conforman la empresa</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    multiline
                    rows={5}
                    variant="outlined"
                    fullWidth
                />
            </FormControl>
        </form>
    );
}
